1957. De Koude Oorlog is op zijn hoogtepunt. Nadat hij op een afgelegen vliegveld ternauwernood ontsnapt aan een groep snode Sovjet agenten, ontmoet de avontuurlijke archeoloog Indiana Jones (Harrison Ford) de jonge, opstandige Mutt (Shia LaBeouf) die zijn hulp nodig heeft bij een persoonlijke missie. In ruil daarvoor maakt Indy grote kans op het vinden van de Crystal Skull van Akator, een legendarisch en fascinerend voorwerp omringd door bijgeloof en gevaar. Indy en Mutt reizen naar de uithoeken van Peru, maar merken al snel dat zij niet de enigen zijn die de Crystal Skull zoeken.:
